INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, 0.0, 24001, 2, 24, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 10046, "アヤネ", 102301, 401, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2.21, 0.0, 24002, 2, 24, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 10046, "アヤネ", 102301, 402, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, 0.0, 24003, 2, 24, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 10046, "アヤネ", 102301, 403, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (1.99, 0.0, 24004, 1, 24, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 10046, "アサヒ", 192201, 701, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2.21, 0.0, 24005, 2, 24, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 10046, "アサヒ", 192201, 702, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (3.33, 0.0, 24006, 1, 24, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 10046, "アサヒ", 192201, 703, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, 0.0, 24007, 2, 24, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 10046, "部員３", 192301, 801, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2.68, 0.0, 24008, 2, 24, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 10046, "部員３", 192301, 802, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, 0.0, 24009, 2, 24, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 10046, "部員３", 192301, 803, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, 0.0, 24010, 1, 24, 0.0, "やった！", 10046, "", 192501, 501, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, 0.0, 24011, 1, 24, 0.0, "勝ったよ！", 10046, "", 192501, 502, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, 0.0, 24012, 1, 24, 0.0, "いい調子！", 10046, "", 192501, 503, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (5.33, 0.0, 24013, 2, 24, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 10046, "ミサト", 113501, 111, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 6);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (6.85, 0.0, 24014, 2, 24, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 10046, "ミサト", 113501, 112, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (3.0, 0.0, 24015, 2, 24, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 10046, "ミサト", 113501, 113, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (6.11, 0.0, 24016, 2, 24, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 10046, "ダイチ", 192401, 611, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (6.75, 0.0, 24017, 2, 24, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 10046, "ダイチ", 192401, 612, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, 0.0, 24018, 2, 24, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 10046, "ダイチ", 192401, 613, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (4.52, 0.0, 24019, 1, 24, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 10046, "ハツネ", 113401, 211, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (3.89, 0.0, 24020, 1, 24, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 10046, "ハツネ", 113401, 212, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (13.49, 0.0, 24021, 2, 24, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 10046, "ハツネ", 113401, 213, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (3.17, 0.0, 24022, 2, 24, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 10046, "カヤ", 106501, 311, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (4.42, 0.0, 24023, 2, 24, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 10046, "カヤ", 106501, 312, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (2.89, 0.0, 24024, 1, 24, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 10046, "カヤ", 106501, 313, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 6);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (3.71, 0.0, 24025, 3, 24, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 10046, "アヤネ", 102301, 421, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 4);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (5.1, 0.0, 24026, 1, 24, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 10046, "アサヒ", 192201, 721, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (4.34, 0.0, 24027, 3, 24, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 10046, "部員３", 192301, 821, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, 0.0, 24028, 1, 24, 0.0, "いい勝負だったよ\nまたやろうね", 10046, "", 192501, 521, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (5.62, 0.0, 24029, 2, 24, -360.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 10046, "ミサト", 113501, 101, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (9.58, 0.0, 24030, 2, 24, -360.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 10046, "ミサト", 113501, 102, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, 0.0, 24031, 2, 24, -360.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 10046, "ミサト", 113501, 103, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (9.13, 0.0, 24032, 1, 24, -360.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 10046, "ミサト", 113501, 104, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 2);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (8.27, 0.0, 24033, 2, 24, -360.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 10046, "ミサト", 113501, 105, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 1);
